import React, { Component } from 'react';
import Header from './header';
import {Container} from 'semantic-ui-react';
class layout extends Component {
    // state = {  }
    render() { 
        return ( 
            <Container>
                <Header/>
                {this.props.children}
            </Container>
        );
    }
}
 
export default layout;
